import React from 'react'
import { LazyLoadImage } from 'react-lazy-load-image-component'

function Stack() {
	return (
		<div className="min-h-screen flex items-center justify-center">
			<h1>Stack I use</h1>
			<LazyLoadImage 
				src={process}
			/>
		</div>
	)
}

export default Stack
